  <script>
      // Fonction pour activer le mode plein écran
      function enterFullScreen() {
      const elem = document.documentElement;
      if (elem.requestFullscreen) {
        elem.requestFullscreen();
      } else if (elem.webkitRequestFullscreen) { // Pour Safari
        elem.webkitRequestFullscreen();
      } else if (elem.msRequestFullscreen) { // Pour IE/Edge
        elem.msRequestFullscreen();
      }
    }

    // Appeler enterFullScreen au chargement
    window.onload = enterFullScreen;

    // Fonction pour surveiller et réactiver le plein écran si nécessaire
    document.addEventListener("fullscreenchange", () => {
      if (!document.fullscreenElement) {
        enterFullScreen(); // Réactiver plein écran si l’utilisateur en sort
      }

// Charger l'animation Lottie avec les données intégrées
const animation = lottie.loadAnimation({
  container: document.getElementById('animation-container'),
  renderer: 'svg', // ou 'canvas' selon votre préférence
  loop: false,
  autoplay: true, // Démarre automatiquement l'animation
  animationData: animationData
});

// Définir les déclencheurs avec les frames et les actions associées
const triggers = [
  { frame: 30, action: () => console.log("Déclencheur à la frame 30") },
  { frame: 60, action: () => console.log("Déclencheur à la frame 60") },
  { frame: 90, action: () => console.log("Déclencheur à la frame 90") }
];

// Variable pour suivre les déclencheurs déjà exécutés
let triggeredIndices = new Set();

// Surveiller la progression de l'animation pour les déclencheurs
animation.addEventListener('enterFrame', () => {
  const currentFrame = Math.round(animation.currentFrame);

  // Gérer les déclencheurs d'action
  triggers.forEach((trigger, index) => {
    if (currentFrame >= trigger.frame && !triggeredIndices.has(index)) {
      trigger.action(); // Exécute l'action
      triggeredIndices.add(index); // Marque l'action comme exécutée
    }
  });
});
